import React from 'react'
import { Link } from 'react-router-dom'
import Card from '../util/Card'
import styles from './SavedPost.module.css'

const SavedPost = ({post}) => {
    return (
            <Card width='100%' height='100px' bg='white' mg='1rem 0'>
                <Link to={`/post/${post._id}`} className={styles.image_wrapper}>
                    {
                        post.media.length > 0 ? (post.media[0].url.match(/video/i)
                        ? <video controls  src={post.media[0].url} alt="video" />
                        : <img className={styles.image} src={post.media[0].url} alt="image" />)
                        : <img src={'dog'} className="image" alt='image' />
                    }
                    {/* <img src={post.media.length > 0 ? post.media[0].url : post.avatar} className="image" alt='image' /> */}
                </Link>
                <div className="body">
                    {post.body}
                </div>
                <div className="post_option">
                    
                </div>
            </Card>
    )
}

export default SavedPost
